import React, { Component } from "react";
import AuthenticationService from '../../authentication/AuthenticationService'
import AssetDataService from '../../api/AssetDataService'
import AssetControlDataService from "../../api/AssetControlDataService"
import { Formik, Form, Field, ErrorMessage } from "formik";

let username = AuthenticationService.getLoggedInUserName();        
let token = AuthenticationService.getLoggedInToken(); 

class ListAssetComponent extends Component {
    constructor(props) {
        super(props)
        this.state = {
        }
        //this.loadAssets = this.loadAssets.bind(this); 
    }

    componentDidMount() {
        //this.loadAssets();        
    }

    render() {
        let {name, date, initial_value, company, interest_rate, is_active, current_value, is_variable_income} = this.state;

        return (
          <div className="text-center">
            <div className="asset">
              <Formik
                initialValues={{name, date, initial_value, company, interest_rate, is_active, current_value, is_variable_income}}
                onSubmit={this.onSubmit}
                validateOnChange={false}
                validateOnBlur={false}
                validate={this.validate}
                enableReinitialize={true}
              >
                {(props) => (
                  <Form>
                    <fieldset className="form-group">
                      <label>Total Patrimony:</label>
                      <Field className="fieldCategA" type="text" name="name" />
                    </fieldset>
                    <fieldset className="form-group">
                      <label>Variable Income Total:</label>
                      <Field className="fieldCategA" type="text" name="name" />
                    </fieldset>
                    <fieldset className="form-group">
                      <label>Value to be Invested:</label>
                      <Field className="fieldCategA" type="text" name="name" />
                    </fieldset>
                    <fieldset className="form-group">
                      <label>You Should Invest in Variable Income:</label>
                      <Field className="fieldCategA" type="text" name="name" />
                    </fieldset>
                    <fieldset className="form-group">
                      <label>You Should Invest in Fixed Income:</label>
                      <Field className="fieldCategA" type="text" name="name" />
                    </fieldset>
                    <button className="btn btn-success" type="submit">
                      Save
                    </button>
                    <button className="btn btn-warning" onClick={this.onCancel} type="button">
                      Cancel
                    </button>
                  </Form>
                )}
              </Formik>
            </div>
          </div>
        );
      }
}

export default ListAssetComponent
